import { Text, View } from 'react-native';
import styles from '../styles/styles';

export default function Listagem() {

    const deslogar = () => {
        siginOut(auth)
        .then((userCredentials) => {
          console.log(userCredentials)
        }).catch((err) => {
          console.error(err)
        })
      }

    return (
    <View style={styles.container}>
        <Text>Listagem</Text>
        
    </View>
  );
}
